import logo from "../assets/logo.png";
import "./Header.style.css";
import { IoHome } from "react-icons/io5";

export const Header = () => {
  return (
    <div>
      <img src={logo} alt="Linkrap Logo" className="logo" />
      <IoHome className="home-icon" />
      <p>헤더입니당</p>
    </div>
  );
};
